import{_ as o,c as t,o as a,ae as n}from"./chunks/framework.CZCz8QqV.js";const h=JSON.parse('{"title":"Community","description":"","frontmatter":{},"headers":[],"relativePath":"resources/community.md","filePath":"resources/community.md"}'),i={name:"resources/community.md"};function r(s,e,l,c,d,u){return a(),t("div",null,e[0]||(e[0]=[n('<h1 id="community" tabindex="-1">Community <a class="header-anchor" href="#community" aria-label="Permalink to &quot;Community&quot;">​</a></h1><p>Moony is more than a token, it’s an open, decentralized movement powered by its community.</p><p>There is no company, central team, or official roadmap. Instead, Moony grows through the initiative of independent contributors: developers, creators, product builders, educators, and everyday users who see value in a monetary system that belongs to no one and works for everyone.</p><h2 id="network-of-stakeholders" tabindex="-1">Network of Stakeholders <a class="header-anchor" href="#network-of-stakeholders" aria-label="Permalink to &quot;Network of Stakeholders&quot;">​</a></h2><p>Moony’s decentralized nature makes it possible for a wide range of participants to contribute, each from their own perspective:</p><ul><li>Developers can build tools, applications, smart contracts, and integrations that expand the Moony ecosystem. From open-source libraries to payment plugins and DEX integrations, the possibilities are as broad as the Solana stack itself.</li><li>Content creators can educate, explain, and spread awareness of Moony’s utility through articles, videos, tutorials, memes, and social threads.</li><li>Businesses, both online and offline, can accept Moony as payment, integrate it into their services, or build products natively denominated in Moony.</li><li>Curators and organizers can host meetups, run Telegram channels, create regional language hubs, or coordinate local initiatives.</li></ul><p>Moony is permissionless infrastructure. Anyone can build, create, or participate without waiting for approval.</p><h2 id="incentives-feedback-loops" tabindex="-1">Incentives &amp; Feedback Loops <a class="header-anchor" href="#incentives-feedback-loops" aria-label="Permalink to &quot;Incentives &amp; Feedback Loops&quot;">​</a></h2><p>Moony’s token mechanics reinforce the organic growth of the ecosystem:</p><ul><li>Proof of Liquidity (PoL) means that new supply is minted by participants who add capital to the reserve, reinforcing Moony’s liquidity and distribution.</li><li>Open utility creates demand: as new apps and use cases emerge, more people transact in Moony—strengthening the incentive for developers, creators, and merchants to support it.</li><li>Network effects compound as usage spreads. Every new wallet, transaction, and integration makes Moony more useful to others.</li><li>No central treasury or fundraising ensures that value flows to contributors based on merit and initiative, not hierarchy.</li></ul><p>In this way, Moony aligns growth with contribution. People are not just incentivized to use the token, but to expand the ecosystem around it.</p><h2 id="composable-movement" tabindex="-1">Composable Movement <a class="header-anchor" href="#composable-movement" aria-label="Permalink to &quot;Composable Movement&quot;">​</a></h2><p>There are no official channels, no central group chats, and no single website that speaks for the network. Instead, we anticipate a diverse array of independent communities to emerge, each with its own focus, personality, and purpose:</p><ul><li>Regional communities organized by geography or language</li><li>Developer groups focused on infrastructure, tooling, or standards</li><li>Product-specific groups centered around payment apps, bots, or consumer tools</li><li>Mission-aligned nonprofits and companies contributing capital, tools, or labor without owning or controlling the protocol</li></ul><p>This model reflects a broader philosophy: Moony isn’t a brand to follow, it’s a tool to use. Each community adds surface area for others to onboard and explore. As different groups create their own entry points, they collectively expand the network’s reach and resilience.</p><h2 id="ways-to-contribute" tabindex="-1">Ways to Contribute <a class="header-anchor" href="#ways-to-contribute" aria-label="Permalink to &quot;Ways to Contribute&quot;">​</a></h2><p>There are countless ways to get involved:</p><ul><li>Build apps, integrations, tools, bots, or user interfaces</li><li>Create educational content, tutorials, explainers, memes, or videos</li><li>Translate resources or start a community group in your region or language</li><li>Organize meetups, hackathons, or online spaces to connect builders and users</li><li>Use Moony as a medium of exchange. Usage is contribution.</li></ul><p>You don’t need permission, funding, or approval to start. Moony is open to anyone willing to build, share, or participate.</p><p>Moony is not owned by any company, individual, or foundation. It is an open source asset built on transparent smart contracts and supported entirely by a public, onchain reserve. From its inception, Moony was designed to function as a public good. It is available to anyone, usable by anyone, and shaped by the people who find value in it.</p><p>As Moony evolves, we expect its network of contributors and communities to evolve alongside it. Developers may integrate Moony into applications and tools. Creators may publish educational content or organize local events. New organizations may form to support adoption, build infrastructure, or advance public understanding. These efforts do not require central coordination. What matters is that they reflect the values of open participation, permissionless access, and long-term sustainability.</p><p>Moony’s future will not be dictated from above. It will be written by those who choose to build, share, and use it. If you are reading this and wondering where to begin, you already have your answer. The next step belongs to you.</p>',22)]))}const m=o(i,[["render",r]]);export{h as __pageData,m as default};
